import React from "react";
import users from "../../apis/users";
import NetflixForm from "./NetflixForm";

function SignUp() {
  onSubmit = async (formValues) => {
    await users.post("/users", {formValues});
  }

  return (
    <NetflixForm title="Sign Up"/>
  );
}

export default SignUp;
